import React from 'react';
import {Media} from 'reactstrap';

export const RenderLeader = (props) => {
    return (
        <div key={props.leader.id}className = "col-12">
        <Media>
            <Media left>
                <Media object src={props.leader.image} alt="Generic placeholder image" />
            </Media>
            <Media body>
                <Media heading>
                    {props.leader.name}
                </Media>
                <h6>{props.leader.designation}</h6>
                {props.leader.description}
            </Media>
        </Media>
        </div>
    );
}
